  return (
    <>
      <Head>
        <title>Prazer, Cuby!</title>
        <Meta />
      </Head>
      <Container>
        <h1>Hello, Header!</h1>
        <ContentHeader>
          teste
        </ContentHeader>
      </Container> 
    </>
  );
}

export default Header;
